import React from "react";

const Fill=(props)=>{
    return(
        <>
        <div className="container fill">
            <div className="row mx-auto">
                <div className="col-md-4">
                    <h1>{props.val1}</h1>
                </div>
            </div>
        </div>
        </>
    );
}
export default Fill;
